import React from "react";
import "../styles/navbar.css";
import logo from "./../resource/logo.png";
//import { Link } from 'react-router-dom';
const Navbar = ()=>{
    return(
        <div className="navbar">
            <img src={logo} />
        <nav>
            <a href="#">HOME</a>
            <a href="#">ABOUT</a>
            <a href="#">TEAM</a>
            <a href="#">SERVICES</a>
            <a href="#">WORK</a>
            <a href="#">CLIENTS</a>
            <a href="#">CONTACT</a>
        </nav>
        </div>
    )
}
export default Navbar
